import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import MAX_LENGTH from '../constant/action-type';

    const styles = {
        card: {
          maxWidth:350,
          height:200,
          margin:'20px auto ',
          backgroundColor: '#eceff1'
        },
        media: {
            height: 50,
          },
        bullet: {
          display: 'inline-block',
          margin: '0 2px',
          transform: 'scale(0.8)',
        },
        title: {
          fontSize: 14,
        },
        pos: {
          marginBottom: 12,
        },
      };

      const style_topline={
          maxWidth:350,
          height:40,
          margin:0,
          backgroundColor:'black'
      }

      const style_midline={
        height:40,
        marginTop: 5,
        width:250
    }

      const Style_visa = {
        maxWidth: 50,
        marginLeft:5,
        maregin:500,
        position:'relative',
        left: 120,
        top:50
        //paddingLeft:
    }

    const style_bullet2 = {
        marginTop:8,
        position:'relative',
        display: 'inline-block',
        left:100    
    }
    const bullet1 = ()=>{

        return(
            <div style={style_bullet2}>
                <span className='bullet'>• </span>
                <span className='bullet'>• </span>
                <span className='classes'>• </span>
                <span className='classes'>• </span>
            </div>
        )
     }


      class SimpleCard extends Component{


        render(){
        const { classes } = this.props;
        const Bullet = bullet1;
        return (
          <Card className={classes.card}>
            <CardContent>
              <Grid item xs={12}>
                <Paper className={classes.paper} style={style_topline}></Paper>
              </Grid>
              <Grid item xs={12} sm={6}>
                <Paper className={classes.paper} style={style_midline}>
                    <Bullet/>
                </Paper>
              </Grid>
              <img style = {Style_visa} src="https://webiconspng.com/wp-content/uploads/2017/09/Visa-PNG-Image-76712.png" alt="visa" />
            </CardContent> 
          </Card>
        );
      }
    }
      SimpleCard.propTypes = {
        classes: PropTypes.object.isRequired,
      };

     export default withStyles(styles)(SimpleCard);
